import React from 'react';
import { Menu, Icon } from 'antd';

const AppTopbar = () => {
    return(
        <div>
          <Menu mode="horizontal">
            <Menu.Item key="mail">
                <Icon type="mail" />
                Navigation One
            </Menu.Item> 
          </Menu>  
        </div>
    );
};

export default AppTopbar;
